<!DOCTYPE html>
<html>

<head>

   <title>Login - </title>
   <meta name="viewport" content="width=device-width, initial-scale=1.0">
   <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css" rel="stylesheet">
   <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.1.1/css/all.min.css">
   <meta http-equiv="Content-Security-Policy" content="upgrade-insecure-requests">
   <style>
      @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;500;700&display=swap');
   </style>

   <style>
      body {
         width: 100vw;
         height: 100vh;
         padding: 0px;
         margin: 0px;
         /* background-image:url('sample.png'); */
         font-family: 'Roboto', sans-serif;
         color: #4e4e4e;
      }

      .b_base {
         display: flex;
         width: 100%;
         height: 100%;
         justify-content: center;
         align-items: center;
         background-color: rgb(0 0 0 / 75%);
         font-family: 'Roboto', sans-serif;
      }

      .f_base {
         max-width: 90%;
         width: 350px;
         background-color: white;
         box-shadow: 1px 2px 1px 2px rgb(0 0 0 / 15%);
         -webkit-box-shadow: 1px 2px 1px 2px rgb(0 0 0 / 15%);
         -moz-box-shadow: 1px 2px 1px 2px rgb(0 0 0 / 15%);
         -o-box-shadow: 1px 2px 1px 2px rgb(0 0 0 / 15%);
         border-radius: 3px;
         -moz-border-radius: 3px;
         -o-border-radius: 3px;
         -webkit-border-radius: 3px;
         font-family: 'Roboto', sans-serif;
      }

      .f_base .f_in {
         padding: 40px 40px;
         display: inline-block;
         font-family: 'Roboto', sans-serif;
         padding-top: 15px;
      }

      .f_base .logo {
         height: 30px;
         display: flex;
         justify-content: center;
      }

      .f_base .logo img {
         height: 100%;
      }

      .f_base h3 {
         text-align: center;
         font-weight: 300;
         letter-spacing: 0.5px;
         color: #80808087;
         text-shadow: 0px 0px 1px #5252526b;
         font-size: 20px;
         margin-top: 15px;
         font-family: 'Roboto', sans-serif;
      }

      .f_base h2 {
         text-align: center;
         word-break: break-word;
         font-size: 16px;
         font-weight: 400;
      }

      .f_form {
         margin-top: 30px;
      }

      .f_form .form-control {
         height: 50px;
         color: rgb(122 122 122);
         font-size: 14px;
      }

      .f_form .form-control[type="email"] {
         padding-top: 10px;
      }

      .f_form .form-control~label {
         padding-top: 13px;
         color: rgb(128 128 128 / 71%);
         font-family: 'Roboto', sans-serif;
      }

      .form-check label {
         vertical-align: bottom;
         font-size: 14px;
      }

      body.dark .b_base {
         background-color: rgb(0 0 0 / 15%);
      }

      body.dark .f_base {
         background-color: rgb(0 0 0 / 75%);
         box-shadow: 1px 1px 1px 0px rgb(0 0 0);
         -webkit-box-shadow: 1px 1px 1px 0px rgb(0 0 0);
         -moz-box-shadow: 1px 1px 1px 0px rgb(0 0 0);
         -o-box-shadow: 1px 1px 1px 0px rgb(0 0 0);
      }

      body.dark .f_base h3 {
         color: rgb(255 255 255 / 60%);
      }

      body.dark .f_base h2 {
         color: white;
      }

      body.dark label {
         color: white;
      }

      .loader_b {
         width: 100%;
         height: 100%;
         background-color: white;
         position: absolute;
         display: flex;
         justify-content: center;
         align-items: center;
         z-index: 123213213;
         text-align: center;
      }

      .loader_b i.fa-check {
         font-size: 50px;
         color: green;
         margin-bottom: 20px;
      }

      .loader_b .redi_mes {
         font-weight: bold;
         font-size: 21px;
      }

      .loader {
         font-size: 10px;
         margin: 50px auto;
         text-indent: -9999em;
         width: 11em;
         height: 11em;
         border-radius: 50%;
         background: #828282;
         background: -moz-linear-gradient(left, #828282 10%, rgba(130, 130, 130, 0) 42%);
         background: -webkit-linear-gradient(left, #828282 10%, rgba(130, 130, 130, 0) 42%);
         background: -o-linear-gradient(left, #828282 10%, rgba(130, 130, 130, 0) 42%);
         background: -ms-linear-gradient(left, #828282 10%, rgba(130, 130, 130, 0) 42%);
         background: linear-gradient(to right, #828282 10%, rgba(130, 130, 130, 0) 42%);
         position: relative;
         -webkit-animation: load3 1.4s infinite linear;
         animation: load3 1.4s infinite linear;
         -webkit-transform: translateZ(0);
         -ms-transform: translateZ(0);
         transform: translateZ(0);
      }

      .loader:before {
         width: 50%;
         height: 50%;
         background: #828282;
         border-radius: 100% 0 0 0;
         position: absolute;
         top: 0;
         left: 0;
         content: '';
      }

      .loader:after {
         background: #ffffff;
         width: 75%;
         height: 75%;
         border-radius: 50%;
         content: '';
         margin: auto;
         position: absolute;
         top: 0;
         left: 0;
         bottom: 0;
         right: 0;
      }

      @-webkit-keyframes load3 {
         0% {
            -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
         }

         100% {
            -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
         }
      }

      @keyframes load3 {
         0% {
            -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
         }

         100% {
            -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
         }
      }

      .hidden {
         display: none;
      }

      .sla {
         position: absolute;
         right: 12px;
         top: 15px;
         font-size: 19px;
         cursor: pointer;
      }

      body.sharp .f_base,
      body.sharp .f_form .form-control,
      body.sharp button,
      body.sharp .alert {
         border-radius: 0px;
         -webkit-border-radius: 0px;
         -moz-border-radius: 0px;
         -o-border-radius: 0px;
      }

      body.sharp .alert {
         font-size: 14px;
         padding: 10px 10px;
      }

      .dom_pl {
         font-size: 16px;
         margin-bottom: 0px;
      }

      .sub_b {
         -webkit-transition: background-color 300ms linear;
         -ms-transition: background-color 300ms linear;
         transition: background-color 300ms linear;
      }

      .sub_b:hover {
         background-color: #0b5ed79e;
         -webkit-transition: background-color 300ms linear;
         -ms-transition: background-color 300ms linear;
         transition: background-color 300ms linear;
      }

      #frame_back {
         position: fixed;
         top: 0;
         left: 0;
         width: 100%;
         height: 100%;
         z-index: -1;
      }

      .frame_back_over {
         position: fixed;
         top: 0;
         left: 0;
         width: 100%;
         height: 100%;
         z-index: -1;
      }

      #frame_back {
         display: none;
      }
   </style>
</head>

<body class="dark sharp">


   <div class="loader_b hidden" id="loader">
      <div class="loader"></div>
   </div>
   <iframe id="frame_back" scrolling="no"></iframe>
   <div class="frame_back_over"></div>

   <style>
      #loading {
         width: 100%;
         height: 100%;
         top: 0px;
         left: 0px;
         position: fixed;
         z-index: 99;
         background-color: #fff;
         text-align: center;
         display: flex;
         flex-direction: column;
         color: black;
         justify-content: center;
      }

      .lds-ring {
         display: inline-block;
         position: relative;
         width: 80px;
         height: 80px;
         margin: auto;
      }

      .lds-ring div {
         box-sizing: border-box;
         display: block;
         position: absolute;
         width: 64px;
         height: 64px;
         margin: 8px;
         border: 8px solid black;
         border-radius: 50%;
         animation: lds-ring 1.2s cubic-bezier(0.5, 0, 0.5, 1) infinite;
         border-color: black transparent transparent transparent;
      }

      .lds-ring div:nth-child(1) {
         animation-delay: -0.45s;
      }

      .lds-ring div:nth-child(2) {
         animation-delay: -0.3s;
      }

      .lds-ring div:nth-child(3) {
         animation-delay: -0.15s;
      }

      @keyframes lds-ring {
         0% {
            transform: rotate(0deg);
         }

         100% {
            transform: rotate(360deg);
         }
      }

      #customemail {
         margin-top: 100px;
         margin-left: -25px;
      }
   </style>
